import React, { useState } from 'react';
import './Login.css';
import '@fortawesome/fontawesome-free/css/all.min.css';
import Swal from "sweetalert2";

const Login = ({ onLogin }) => {
  const [userId, setUserId] = useState('');
  const [password, setPassword] = useState('');
  const [partitionId, setPartitionId] = useState('');
  const [outputText, setOutputText] = useState('');

  const handleLogin = async () => {
    const loginCommand = `login -user="${userId}" -pass="${password}" -id="${partitionId}"`;
    try {
      if (!userId || !password || !partitionId) {
        Swal.fire('Error al iniciar sesión', 'Todos los campos son obligatorios', 'error');
        return;
      }

      const response = await fetch('http://localhost:8080/AnalizadorGo/ProcesarComando', {
        method: 'POST',
        headers: {
          'Content-Type': 'text/plain',
        },
        body: loginCommand,
      });

      const text = await response.text();
      setOutputText(text);

      Swal.fire('Inicio de sesión exitoso', 'Bienvenido a la aplicación', 'success');
      onLogin(); // Llama a la función de éxito de login si es necesario
    } catch (error) {
      console.error('Error al enviar el texto:', error);
      const errorMessage = error.response?.data?.error || 'Error desconocido';
      Swal.fire('Error al iniciar sesión', errorMessage, 'error');
      setOutputText(`Error: ${errorMessage}`);
    }
  };

  return (
    <div className="login-container">
      <h2 className="login-title">Login</h2>
      <div className="login-mb">
        <label className="login-label">
          <i className="fas fa-id-badge"></i> ID Partición
        </label>
        <input
          type="text"
          className="login-input"
          placeholder="Ingrese el ID de la partición"
          value={partitionId}
          onChange={(e) => setPartitionId(e.target.value)} // Actualiza el valor de partitionId
        />
      </div>
      <div className="login-mb">
        <label className="login-label">
          <i className="fas fa-user"></i> Usuario
        </label>
        <input
          type="text"
          className="login-input"
          placeholder="Ingrese su usuario"
          value={userId}
          onChange={(e) => setUserId(e.target.value)} // Actualiza el valor de userId
        />
      </div>
      <div className="login-mb">
        <label className="login-label">
          <i className="fas fa-lock"></i> Contraseña
        </label>
        <input
          type="password"
          className="login-input"
          placeholder="Ingrese su contraseña"
          value={password}
          onChange={(e) => setPassword(e.target.value)} // Actualiza el valor de password
        />
      </div>
      <button className="login-btn" onClick={handleLogin}>
        <i className="fas fa-sign-in-alt"></i> Iniciar sesión
      </button>
    </div>
  );
};

export default Login;
